import { Injectable } from '@angular/core';
import { HttpClient } from "@angular/common/http";
import { Observable } from "rxjs";

@Injectable({
  providedIn: 'root'
})
export class SymbolSearchServiceService {
  starter_url = 'https://www.alphavantage.co/query?function=SYMBOL_SEARCH&keywords=';
  api_key = 'XGN36Q0ICTGL1ZWD';
  search_results: Observable<Object[]> = []; // change to observable
  constructor(private http: HttpClient) { }

  symbol_search(input: string) {
    let final_url = this.starter_url + input + '&apikey=' + this.api_key;
    console.log("input: ", input)
    console.log("search result", this.http.get(final_url))
    this.search_results = this.http.get(final_url) as Observable<Object[]>; // return observable
  }
}
